// src/components/ProfileImage.js
import React from 'react';
import MariaImage from '../img/Maria.jpg'; // Убедитесь, что путь правильный

const ProfileImage = () => {
    return (
        <img className="profile-image" src={MariaImage} alt="Maria Abrosova" />
    );
};

export default ProfileImage;
